We tried their recommended dishes&nbsp;

ğŸ”¸ï¸Claypot Frog Leg with Spring Onions and Ginger: The frog legs are juicy and tender! It pairs really well with their creamy plain porridge (served in a claypot too)ğŸ˜˜

 For the best experience, drizzle some sauce from the Claypot Frog Leg into the porridge. Frog thighs are rich in omega-3 fatty acids, potassium and vitamin A. The taste and texture of the meat is softer, like a mixture of chicken and fish. Compared to grilled chicken breast, frog meat has far more protein and is lower in fatğŸ¸&nbsp;

ğŸ”¸ï¸Curry Fish Head: The fish is so fresh and huge, which makes it so enjoyable. The curry is thick and coats the accompanying ingredients so wellğŸ¤¤ğŸŒ¹ Thereâ€™s brinjal, beancurd skin and other vegetables that make the meal very wholesome.&nbsp;

ğŸ”¸ï¸Broccoli with scallops & mushroom: Itâ€™s always a good idea to order a plate of greens to accompany all the meat dishes. The scallops are huge and savory!&nbsp;

ğŸ”¸ï¸Sliced fish with Spring Onions: For the lazy foodies who want to enjoy fish without removing their bones, this is the dish for you. The smooth and tender fish slices get a huge thumbs up from us.&nbsp;

