Super Loco

I have to give a huge shout-out to the staff at Super Loco Robertson Quay for their amazing service! The servers has such a positive attitude and were very attentive, making this a very pleasant dining experience.

Crab Tostadas ($16) - This might have been the dish of the night for me. Fresh, chilled crab mayo covered the crisp tostada, topped with smooth avocado cream. Ridiculously good!&nbsp;

Trio - Chips, Guac, Salsa ($13) - You have to start a Mexican meal with chips and dip. The guac was creamy and the salsa was packed with flavour. Pro-tip: Dunk the chip in both the guac and salsa in the same bite!

Elotes ($7) - Elotes are barbequed corn coated with chipotle mayo and cotija cheese. As someone who doesn't like corn, this was a tasty way to trick my body into eating it.&nbsp;

Tacos ($9-11 per taco) - Their tacos are really well-balanced, both texturally and flavour-wise.

The lamb one had a nice sear and was accompanied by a mint sauce.&nbsp;

The fish one had a huge chunk of crunchy white, fried fish, which went perfectly with the sweet and sour mango salsa.&nbsp;

I had never eaten cactus before, so I was excited to try this one. It tasted like fried zucchini to me, which was nice, but I didn't really enjoy the cauliflower pieces in this one.&nbsp;

Pork Ribs ($32) - The pork ribs tasted like your classic BBQ-sauce slathered ribs. While they were tender, they didn't really incorporate any Mexican flavours.

